import React from 'react'
import { BrowserRouter, Switch, Route } from 'react-router-dom';
// import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import ClientList from './pages/ClientsList';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component= { ClientList }/>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
